import { makeStyles } from '@material-ui/core'


export default makeStyles((theme) => ({
    root: {
        // flexGrow: 1,
        // width: '75vw',
        height: '100vh',
        display: 'flex',
        flexDirection: 'column',
        alignItems:'center',
        justifyContent:'center',
        // [theme.breakpoints.down('xs')]: {
        //     width: '100vw',

        // }
    },
    homeDisplay: {
        //display: 'flex',
        flexDirecton: 'column',
        alignItems: 'center',
        justifyContent: 'center',
    },
    cardDisplay: {
        width: 150,
        height: 110,
        borderRadius: 10,
        zIndex: 0,
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center',
        // background: 'linear-gradient(90deg, #00C9FF 0%, #92FE9D 100%)',
        background: theme.palette.primary.main,
        boxShadow: '0 5px 40px -12px rgba(0,0,0,0.8)',
        [theme.breakpoints.down('sm')]: {
            width: 120,
            height: 100,
        },
        [theme.breakpoints.down('xs')]: {
            width: 120,
            height: 100,
        },
        '& hover': {
            backgroundImage: theme.palette.secondary.main,
        }
    },
    titleCard: {
        width: 400,
        height: 400,
        borderRadius: 50,
        boxShadow: '0 5px 40px -12px rgba(0,0,0,0.8)',
        display: 'flex',
        direction: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        [theme.breakpoints.down('sm')]: {
            marginTop: 30,
        },
        // [theme.breakpoints.down('xs')]: {
        //     height: 300,
        // },
    },
    title: {
        position: 'absolute',
        fontSize: 50,
        fontWeight: 1000,
        top: 105,

        textTransform: 'uppercase',
        color: '#23282E',
        [theme.breakpoints.down('sm')]: {
            top: 177,
        },
        // [theme.breakpoints.down('sm')]: {
        //     fontSize: 22,
        // },
    },
    logo: {
        position: 'relative',
        width: 150,
        left: 150,
        top: 150,
    },
}))
